import Phaser from "phaser"
import SceneKeys from "../consts/SceneKeys"
import TextureKeys from "../consts/TextureKeys"
import AnimationKeys from "../consts/AnimationKeys"

export default class Preloader extends Phaser.Scene {
    constructor() {
        super(SceneKeys.Preloader)
    }

    preload() {
        this.load.image(TextureKeys.Background, './assets/img_background2.png')
        this.load.image(TextureKeys.PipeUp, './assets/img_pipe_upper.png')
        this.load.image(TextureKeys.PipeDown, './assets/img_pipe_lower.png')
        this.load.image(TextureKeys.GameOver, './assets/img_game_over.png')
        this.load.image(TextureKeys.ScoreBoard, './assets/img_score_board.png')
        this.load.image(TextureKeys.StartButton, './assets/img_start.png')
        this.load.image(TextureKeys.StartButton, './assets/img_start.png')
        this.load.image(TextureKeys.Name, './assets/img_name.png')
        this.load.image(TextureKeys.Instruction, './assets/img_instruction.png')
        this.load.image(TextureKeys.RestartButton, './assets/img_restart.png')

        this.load.atlas(
            TextureKeys.Bird,
            './assets/bird.png',
            './assets/bird.json'
        )
    }

    create() {

        this.anims.create({
            key: AnimationKeys.BirdFly,
            frames: this.anims.generateFrameNames(TextureKeys.Bird, {
                start: 0,
                end: 7,
                prefix:'bird_',
                suffix: '.png'
            }),
            frameRate: 10,
            repeat: -1
        })

        this.anims.create({
            key: AnimationKeys.BirdFall,
            frames: [{key: TextureKeys.Bird, frame: '/bird_0.png'}],
        })


        this.scene.start(SceneKeys.GameStart)
    }


}
